This compelling investment opportunity offers the following key attributes:

- Dominant corner position, less than 14km* to the Brisbane CBD;

- Long WALE – 10.9* years (by income);

- Income growth via strong net leases with annual increases;

- Substantial depreciation benefits from brand new construction;

- Security of income with the centre 91% occupied by leading national tenants;

- Anchored by 7-Eleven, the largest convenience and petrol retailer in Australia with more than 650 stores;

- Prominent location with significant frontage to 44,000* cars daily on a major arterial road and Gateway Motorway entrance; and

- $406,145 pa* net passing income as at 1 July 2019.

